import React, { useState } from 'react';
import { useMutation } from '@apollo/client';
import { gql } from 'apollo-boost';

const SUBMIT_FORM_MUTATION = gql`
  mutation SubmitForm($input: FormInputType!) {
    submitForm(input: $input) {
      id
      field1
      field2
    }
  }
`;

const Form = () => {
  const [formState, setFormState] = useState({ field1: '', field2: '' });
  const [submitForm, { data }] = useMutation(SUBMIT_FORM_MUTATION);

  const onSubmit = async (event) => {
    event.preventDefault();
    try {
      const { data } = await submitForm({ variables: { input: formState } });
      console.log(data);
    } catch (err) {
      console.error(err);
    }
  };

  const onChange = (event) => {
    setFormState({
      ...formState,
      [event.target.name]: event.target.value,
    });
  };

  return (
    <form onSubmit={onSubmit}>
      <input name="field1" value={formState.field1} onChange={onChange} />
      <input name="field2" value={formState.field2} onChange={onChange} />
      <button type="submit">Submit</button>
    </form>
  );
};

export default Form;
```
